'Malin Therese Alshammar' (born 26 August 1977 in Solna Municipality, Stockholm
County) is a Swedish swimmer who has won three Olympic medals, 25 World
Championship medals, and 43 European Championship medals. Standing at 1.80 m,
she is a specialist of short races in freestyle and butterfly. She is coached by
former Swedish swimmer Johan Wallberg.
